import React from "react";
import Navbar from "./NavBar";

const Home = () => {
  return (
    <>
      <Navbar />
      <div className="home">
        <div className="card">
          <div className="card-header">
            <div className="card-pic">
            <img
              src="https://images.unsplash.com/photo-1499996860823-5214fcc65f8f?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8OHx8aHVtYW58ZW58MHx8MHx8fDA%3D&auto=format&fit=crop&w=800&q=60"
              alt=""
            />
            </div>
            <h3>Anubhav</h3>
          </div>
          <div className="card-image">
            <img src="https://images.unsplash.com/photo-1500485035595-cbe6f645feb1?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8c2NlbmVyeXxlbnwwfHwwfHx8MA%3D%3D&auto=format&fit=crop&w=800&q=60" alt=""/>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
